import React from 'react'
import Layouts from '../Layouts/Layouts'
import student from './../assests/images/Icons/student.png';
import HomeIcons from '../Components/HomeIcons';

function Home() {  
  const homeData = [
    {src: student, title: 'Add Student', toRoute: '/s/addStudeent'},
    {src: student, title: 'Update Student Data', toRoute: '/s/addStudeent'},
    {src: student, title: 'Add teacher', toRoute: '/s/addStudeent'},
    {src: student, title: 'Update Teacher Data', toRoute: '/s/addStudeent'},
    {src: student, title: 'Projects', toRoute: '/s/addStudeent'},
    {src: student, title: 'Projects', toRoute: '/s/addStudeent'},
    {src: student, title: 'Projects', toRoute: '/s/addStudeent'},
    {src: student, title: 'Projects', toRoute: '/s/addStudeent'}
  ]

  return (
    <Layouts>
      <div className='flex flex-col lg:flex-row md:flex-row items-center justify-between gap-10 p-10' style={{ zIndex: 0 }}>
        {homeData.map((data, key) => (
          <div key={key}>
            <HomeIcons src={data.src} title={data.title} toRoute={data.toRoute} />
          </div>
        ))}
      </div>
    </Layouts>
  )
}

export default Home;
